    function lienminh(Request $request){
        if (!empty($request->getContent())) {
            $body = json_decode($request->getContent(), true);
            if (empty($body)) {
                parse_str($request->getContent(), $body);
            }
        }
        $input = array_merge($body??[], $request->all());
        $result = [];
        $cat_ids = Group::where(['position' => 'lienminh', 'module' => 'acc_category'])->pluck('id')->toArray();
        try {
            $action = $input['action']??'null_acction';
            // Storage::disk('public')->put("callback/lienminh/request-{$action}-".time()."-".rand(100,999).".json", json_encode($input));
            switch ($input['action']) {
                case 'get_account':
                    if (!empty($input['test'])) {
                        $result = ['id' => 1, 'username' => 'longvipkkk147', 'password' => $this->encrypt('2020abcd')];
                    }else{
                        $acc = $this->lock("lienminh_get_account_auto", function () use($input, $cat_ids) {
                            $acc = Nick::where(['status' => 7, 'module' => 'acc'])->whereIn('parent_id', $cat_ids)->orderBy('started_at', 'asc')->first();
                            if (!empty($acc)) {
                                $acc->fill(['started_at' => date('Y-m-d H:i:s')])->save();
                                $acc->slug = Helpers::Decrypt($acc->slug, config('etc.encrypt_key'));
                            }
                            return $acc;
                        });
                        if (!empty($acc)) {
                            $result = ['id' => $acc->id, 'username' => $acc->title, 'password' => $this->encrypt($acc->slug)];
                        }else{
                            return response('NULL');
                        }
                    }
                break;
                case 'callback_info':
                    if (!empty($input['data']) && !is_array($input['data'])) {
                        try {
                            $input['data'] = json_decode($input['data'], true);
                        } catch (\Exception $e) {}
                    }
                    $unique = date('Y-m-d_H-i-s_').rand(100, 999);
                    $result['store_log'] = Storage::disk('public')->put("callback/lienminh/{$input['id']}-{$unique}.json", json_encode($input));
                    $acc = Nick::where(['status' => 7, 'module' => 'acc', 'id' => $input['id']])->whereIn('parent_id', $cat_ids)->first();
                    if (!empty($acc)) {
                        $acc->fill(['seo_description' => $input['message']]);
                        if(in_array($input['status'], [2,3])){
                            $acc->fill(['status' => 4])->save();
                        }elseif (empty($input['data'])) {
                            $acc->fill(['status' => 7])->save();
                        }elseif ($input['status'] == 1) {
                            $json_data = $input['data'];
                            $props = GameAutoProperty::where(function($query) use($json_data){
                                $query->where(['key' => 'champions'])->whereIn('keyid', array_column($json_data['mastery'], 'championId'));
                            })->orWhere(function($query) use($json_data){
                                $query->where(['key' => 'skins'])->whereIn('keyid', explode(',', $json_data['skins']));
                            })->orWhere(function($query) use($json_data){
                                $query->where(['key' => 'chromas'])->whereIn('keyid', explode(',', $json_data['chromas']));
                            })->orWhere(function($query) use($json_data){
                                $query->where(['key' => 'tftcompanions'])->whereIn('keyid', explode(',', $json_data['tftcompanions']));
                            })->orWhere(function($query) use($json_data){
                                $query->where(['key' => 'tftmapskins'])->whereIn('keyid', explode(',', $json_data['tftmapskins']));
                            })->orWhere(function($query) use($json_data){ 
                                $query->where(['key' => 'tftdamageskins'])->whereIn('keyid', explode(',', $json_data['tftdamageskins']));
                            })->orWhere(function($query) use($json_data){
                                $query->where(['key' => 'wards'])->whereIn('keyid', explode(',', $json_data['ward']));
                            })->orWhere(function($query) use($json_data){
                                $query->where(['key' => 'emotes'])->whereIn('keyid', explode(',', $json_data['emotes']));
                            })->orWhere(function($query) use($json_data){
                                $query->where(['key' => 'icons'])->whereIn('keyid', explode(',', $json_data['icons']));
                            })->select('id', 'key', 'keyid')->get();
                            $pivot = [];
                            foreach ($props as $key => $value) {
                                if ($value->key == 'champions') {
                                    $champion = \Arr::first($json_data['mastery'], function($val, $key) use($value){
                                        return $val['championId'] == $value->keyid;
                                    });
                                    $pivot[$value->id] = ['level' => $champion['championLevel'], 'point' => $champion['championPoints'], 'grade' => $champion['highestGrade']];
                                }else{
                                    $pivot[$value->id] = [];
                                }
                            }
                            $acc->game_auto_props()->sync($pivot);
                            $params = json_decode(json_encode($acc->params??[]), true);
                            $params['rank_info'] = $json_data['rank'];
                            $params['rank_level'] = $json_data['level'];
                            if (empty($params['count'])) {
                                $params['count'] = [];
                            }
                            foreach ($props->groupBy('key') as $key => $value) {
                                $params['count'][$key] = $value->count();
                            }
                            if (!empty($input['data']['screen_shot'])) {
                                try {
                                    $image = base64_decode($input['data']['screen_shot']);
                                    $image = MediaHelpers::HandleImage($image, "upload/product-acc/{$acc->id}", "thumb", 480, 350);
                                    if (!empty($image)) {
                                        $acc->fill(['image' => $image."?t=".time()]);
                                    }
                                } catch (\Exception $e) {
                                }
                            }
                            if (!empty($input['data']['screen_shot_bst'])) {
                                $image_extension = explode('|', $acc->image_extension);
                                try {
                                    $image = base64_decode($input['data']['screen_shot_bst']);
                                    $image = MediaHelpers::HandleImage($image, "upload/product-acc/{$acc->id}", "bst", 480, 350);
                                    if (!empty($image)) {
                                        $image_extension[] = $image."?t=".time();
                                        $acc->fill(['image_extension' => implode('|', $image_extension)]);
                                    }
                                } catch (\Exception $e) {
                                }
                            }
                            $acc->fill(['params' => $params, 'status' => 1])->save();
                        }
                    }
                    $result = ['success' => empty($acc)? 0: 1, 'message' => empty($acc)? "ID {$input['id']} không còn hiệu lực cập nhật": "Thành công"];
                break;
                default:
                    // code...
                break;
            }
        } catch (\Exception $e) {
            $result = ['error' => $e->getMessage(), 'desc' => "Error line: ".$e->getLine()];
        }
        return response()->json($result);
    }
