    function nro(Request $request){
        if (!empty($request->getContent())) {
            $body = json_decode($request->getContent(), true);
            if (empty($body)) {
                parse_str($request->getContent(), $body);
            }
        }
        $input = array_merge($body??[], $request->all());
        $result = [];
        
        $cat_ids = Group::where(['position' => 'nro', 'module' => 'acc_category'])->pluck('id')->toArray();
        try {
            $action = $input['action']??'null_acction';
            switch ($input['action']) {
                case 'get_account':
                    $list = Nick::where(['status' => 7, 'module' => 'acc', 'target' => 1])->whereIn('parent_id', $cat_ids)->orderBy('started_at', 'asc')->limit(5)->get();
                    foreach ($list as $key => $item) {
                        $item->fill(['started_at' => date('Y-m-d H:i:s')])->save();
                        $result[] = ['id' => $item->id, 'username' => $item->title, 'server' => $item->params->server??null,
                            'password' => $this->encrypt(Helpers::Decrypt($item->slug, config('etc.encrypt_key'))),
                            'callback_url' => route('api.upnick.nro', ['action' => 'callback_info', 'id' => $item->id])
                        ];

                    }
                break;
                case 'callback_info':
                    if (!empty($input['data']) && !is_array($input['data'])) {
                        try {
                            $input['data'] = json_decode($input['data'], true);
                        } catch (\Exception $e) {}
                    }
                    $unique = date('Y-m-d_H-i-s_').rand(100, 999);
                    $result['store_log'] = Storage::disk('public')->put("callback/nro/{$input['id']}-{$unique}.json", json_encode($input));
                    $acc = Nick::where(['status' => 7, 'module' => 'acc', 'id' => $input['id']])->whereIn('parent_id', $cat_ids)->first();
